      SELECT ALL ( - col2 ) * col1 + col0 * - + ( CAST ( col1 AS INTEGER ) ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NULL ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q9612.out
    data: |
